      }
    };

    const result = getResult(buttonId, randomNumber);

  return (
    <div>
      <h2>Button ID: {buttonId}</h2>
      <h2>Random Number: {randomNumber}</h2>
      <h2>Result: {result}</h2>
    </div>
  );
} 


